A recent study, conducted by @Always_brand, revealed that since the COVID-19 pandemic, more than 1 in 3 young people feel less confident because they’ve missed after-school activities and nearly 1 out of 3 parents are worried about their ongoing ability to afford period products - an issue known as “period poverty”.
 
When girls do not have access to period products, the uneasy feeling of being unprotected places their confidence, dignity, and education at risk. They’re less likely to participate in educational & other activities, and if they do, they’re more likely to feel distracted and unable to focus on reaching their full potential. Personally, I wouldn’t feel comfortable walking into a studio to dance in a leotard and tights if I did not have full protection and coverage during my period. 
 
Despite the ongoing challenges which, most recently, have been accentuated by the pandemic, @Always_brand wants to help #EndPeriodPoverty and show girls that they’re #SupportedAlways so that periods don’t hold young people back - and here's where we all come in! 

